INSERT INTO `book` (`id`, `language_id`, `editor_id`, `title`, `image`, `release_date`, `nb_pages`, `summary`, `acquisition_date`) VALUES
(1, 1, 1, 'Du sang, des larmes et des pixels', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d73677465447741415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126656467653d6375726c26736f757263653d6762735f617069, '2018-06-07', 246, 'Le premier essai des éditions Mana Books ! Destiny, Diablo III ou encore Uncharted 4 : des jeux encensés par la critique comme par les joueurs. Et pourtant, la création de chacun de ces titres tient du miracle. Des difficultés de planning de Dragon Age : Inquisition aux problèmes de financement de Pillars of Eternity, Jason Schreier (Kotaku) nous emmène dans les coulisses du développement chaotique des plus belles réussites vidéoludiques de ces dernières années.', '2023-03-27'),
(2, 1, 2, 'Read/Write Book 2', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d6f79784c454141415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126656467653d6375726c26736f757263653d6762735f617069, '2012-09-21', 264, 'Qu’est-ce que les humanités numériques ? Apparue en 2006, l’expression connaît depuis un véritable succès. Mais au-delà du slogan à la mode, quelle est la réalité des pratiques qu’il désigne ? Si tout le monde s’accorde sur une définition minimale à l’intersection des technologies numériques et des sciences humaines et sociales, les vues divergent lorsqu’on entre dans le vif du sujet. Les humanités numériques représentent-elles une véritable révolution des pratiques de recherche et des paradigmes intellectuels qui les fondent ou, plus simplement, une optimisation des méthodes existantes ? Constituent-elles un champ suffisamment structuré pour justifier une réforme des modes de financement de la recherche, des cursus de formation, des critères d’évaluation ? L’archive numérique offre-t-elle à la recherche suffisamment de garanties ? Quelle place la recherche « dirigée par les données » laisse-t-elle à l’interprétation ? Telles sont quelques-unes des questions abordées par ce deuxième opus de la collection « Read/Write Book ». Ces dix-huit textes essentiels, rédigés ou traduits en français par des chercheurs de différentes nationalités, proposent une introduction aux humanités numériques accessible à tous ceux qui souhaitent en savoir plus sur ce domaine de recherche en constante évolution.', '2023-03-27'),
(3, 1, 3, 'L\'Art d\'Aimer', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d63574d787a6745414341414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126736f757263653d6762735f617069, '2021-02-09', 122, 'Dans cette oeuvre sans nulle autre pareille, Ovide nous propose une initiation à l\'Art de l\'Amour, un guide poétique et philosophique de la séduction. D\'une modernité surprenante, c\'est aussi une réflexion novatrice pour l\'époque sur les rapports amoureux. Extrait: Tandis que Vénus m\'inspire, jeunes beautés, prêtez l\'oreille à mes leçons. La pudeur et les lois vous le permettent; votre intérêt vous y invite. Songez dès à présent à la vieillesse qui viendra trop tôt, et vous ne perdrez pas un instant. Tandis que vous le pouvez, et que vous en êtes encore à vos années printanières, donnez-vous du bon temps; comme l\'eau s\'écoulent les années. Le flot qui fuit ne reviendra plus à sa source; l\'heure une fois passée est passée sans retour. Profitez du bel âge: il s\'envole si vite !', '2023-03-27'),
(4, 1, 4, 'Les quatre accords toltèques', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d476a4348454141415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126656467653d6375726c26736f757263653d6762735f617069, '2016-05-25', 108, 'Découvrez ou redécouvrez Les quatre accords toltèques, et prenez comme des millions de lecteurs en France et à travers le monde, la voie de la liberté personnelle. Dans ce livre, Don Miguel révèle la source des croyances limitatrices qui nous privent de joie et créent des souffrances inutiles. Il montre en des termes très simples comment on peut se libérer du conditionnement collectif - le \"rêve de la planète\", basé sur la peur - afin de retrouver la dimension d\'amour inconditionnel qui est à notre origine et constitue le fondement des enseignements toltèques que Castenada fut le premier à faire découvrir au grand public. Don Miguel révèle ici 4 clés simples pour transformer sa vie et ses relations, tirées de la sagesse toltèque. Leur application au quotidien permet de transformer rapidement notre vie en une expérience de liberté, de vrai bonheur et d\'amour. Les quatre accords toltèques : 1 - Que ta parole soit impeccable ; 2 - Ne réagis à rien de façon personnelle ; 3 - Ne fais aucune supposition ; 4 - Fais toujours de ton mieux. Nouvelle édition tant attendue en format poche de ce best-seller ! 750\'000 exemplaires vendus en France de ce texte de référence en développement personnel. UN ÉVÉNEMENT !', '2023-03-27'),
(5, 1, 5, 'Compilateurs', NULL, '1998-03-27', 875, NULL, '2023-03-27'),
(6, 1, 6, 'Klara et le Soleil', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d37796b34454141415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126656467653d6375726c26736f757263653d6762735f617069, '2021-08-19', 280, 'Klara est une AA, une Amie Artifi cielle, un robot de pointe ultraperformant créé spécialement pour tenir compagnie aux enfants et aux adolescents. Klara est dotée d’un extraordinaire talent d’observation, et derrière la vitrine du magasin où elle se trouve, elle profite des rayons bienfaisants du Soleil et étudie le comportement des passants, ceux qui s’attardent pour jeter un coup d’œil depuis la rue ou qui poursuivent leur chemin sans s’arrêter. Elle nourrit l’espoir qu’un jour quelqu’un entre et vienne la choisir. Lorsque l’occasion se présente enfin, Klara est toutefois mise en garde : mieux vaut ne pas accorder trop de crédit aux promesses des humains... Après l’obtention du prix Nobel de littérature, Kazuo Ishiguro nous offre un nouveau chef-d’œuvre qui met en scène avec virtuosité la façon dont nous apprenons à aimer. Ce roman, qui nous parle d’amitié, d’éthique, d’altruisme et de ce qu’être humain signifie, pose une question à l’évidence troublante : à quel point sommes-nous irremplaçables ?', '2023-03-27'),
(7, 1, 7, 'L\'art de la niaque', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d35393267446741415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126736f757263653d6762735f617069, '2017-04-12', 350, 'Comment la passion et de la persévérance forgent les destins et comment la cultiver ? La psychologue Angela Duckworth démontre aux parents, étudiants, enseignants, sportifs et entrepreneurs – aguerris ou néophytes – que le secret d’un succès éclatant ne réside pas dans de quelconques prédispositions mais dans ce qu’elle entend par « pugnacit頻 : la passion alliée à la persévérance. Enseignante-chercheuse de renom, Angela Duckworth évoque ici ses passages successifs par l’enseignement, le conseil aux entreprises et les neurosciences pour étayer son hypothèse que le succès ne s’explique pas par le « génie » mais un dosage unique de passion et d’opiniâtreté. Au fil des pages, elle conduit le lecteur auprès de sportifs, d’artistes, de militaires, de grands hommes d’affaires, d’enseignants qui leur livrent comment ils ont développé leur pugnacité. Dénichant des pépites dans l’histoire de la psychologie, elle suggère quelles leçons tirer des travaux les plus récents sur ceux qui excellent dans leur domaine. Vous apprendrez entre autres : Pourquoi le moindre effort en vue d’atteindre votre objectif compte double. Comment s’acquiert la pugnacité indépendamment du QI ou des circonstances. Comment aider nos enfants à se concentrer durablement sur leurs activités ? Quelle part d’un entraînement optimal implique de la souffrance et quelle part mène à l’extase. Ce qui vaut mieux pour un enfant, d’un soutien inconditionnel ou d’un haut niveau d’exigence. Vous y découvrirez ce qui se passe dans votre esprit quand vous butez contre un obstacle, et que tout part de là – plutôt que du talent ou de la chance. Traduit de l’anglais par Marie Boudewyn', '2023-03-27'),
(8, 1, 8, 'Sapiens', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d4d383979436741415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126656467653d6375726c26736f757263653d6762735f617069, '2015-09-02', 512, 'Il y a 100 000 ans, la Terre était habitée par au moins six espèces différentes d\'hominidés. Une seule a survécu. Nous, les Homo Sapiens. Comment notre espèce a-t-elle réussi à dominer la planète ? Pourquoi nos ancêtres ont-ils uni leurs forces pour créer villes et royaumes ? Comment en sommes-nous arrivés à créer les concepts de religion, de nation, de droits de l\'homme ? À dépendre de l\'argent, des livres et des lois ? À devenir esclaves de la bureaucratie, des horaires, de la consommation de masse ? Et à quoi ressemblera notre monde dans le millénaire à venir ? Véritable phénomène d\'édition, traduit dans une trentaine de langues, Sapiens est un livre audacieux, érudit et provocateur. Professeur d\'Histoire à l\'Université hébraïque de Jérusalem, Yuval Noah Harari mêle l\'Histoire à la Science pour remettre en cause tout ce que nous pensions savoir sur l\'humanité : nos pensées, nos actes, notre héritage... et notre futur.', '2023-03-27'),
(9, 1, 9, 'Le Cerveau de votre enfant', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d64546342454141415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126656467653d6375726c26736f757263653d6762735f617069, '2015-03-16', 141, 'La Bible de l\'éducation positive LES PARENTS ONT BESOIN D\'UN MODE D\'EMPLOI ADAPTÉ AUX ENFANTS D\'AUJOURD\'HUI Comment élever mon enfant ? Comment l\'aider à être heureux, équilibré, respectueux des autres ? Que fautil faire, ne pas faire ? Y a-t-il une méthode efficace pour gérer les peurs, les colères ? Ces questions, tous les parents se les posent. Aujourd\'hui, les découvertes sur le cerveau jettent une lumière nouvelle sur le comportement des enfants. Ce livre met à la portée des parents les éléments de base pour comprendre et agir. IL EST POSSIBLE D\'AGIR POSITIVEMENT SUR LE CERVEAU DE L\'ENFANT Le cerveau est notre organe le plus complexe : il comprend deux hémisphères, plusieurs aires – dont certaines sont dédiées au comportement moral, d\'autres aux décisions ou à la motivation –, plusieurs \" étages \" – cerveau reptilien, limbique et cortex. La clé est de les intégrer dans un même circuit, comme les différents systèmes du corps humain. Quand tous ces éléments ne fonctionnent pas ensemble surviennent les problèmes : colères, caprices, agressivité. Par notre comportement en tant que parents, nous pouvons agir sur le bon fonctionnement du cerveau de l\'enfant. UNE MERVEILLE DE PÉDAGOGIE ILLUSTRÉE Il mêle le savoir et la pratique. Chaque chapitre présente une connaissance sur le cerveau (les deux hémisphères, les deux étages du cerveau) et des techniques pour intégrer ce savoir au quotidien de l\'enfant. Ces techniques sont systématiquement illustrées par : – Des scenettes sous formes de BD pour montrer des situations familières (opposition, troubles émotionnels) et expliquer au parents comment y répondre. – D\'autres sont destinées à expliquer aux enfants le fonctionnement de leur cerveau.', '2023-03-27'),
(10, 1, 10, 'La méthode Value Proposition Design', NULL, '2015-05-29', 320, 'Suite attendue du bestseller Business Model Nouvelle Génération, ce livre est indispensable pour proposer une offre de produits et services en phase avec les attentes des clients.', '2023-03-27'),
(11, 1, 5, 'Découvrez vos points forts avec le test CliftonStrengths', NULL, '2019-04-19', 172, 'Connaissez-vous vos points forts ? Comme la majorité des individus vous êtes sûrement plus conscients de vos faiblesses. Aussi vous passez votre vie à vouloir les surmonter, alors qu\'il faudrait axer votre développement sur vos forces et bâtir votre existence autour d\'elles ; : en agissant ainsi, vos capacités de progression dans l\'entreprise, d\'épanouissement personnel et votre bonne santé mentale seront décuplées ! Gallup a mis au point un test, CliftonStrengths, qui vous permettra de découvrir vos points forts. Il se compose d\'un questionnaire en ligne de 30 minutes, durant lequel vous devrez répondre à 177 déclarations qui vous permettront de découvrir vos talents parmi 34 thèmes. Ce livre offre un accès, grâce à un code à gratter, au test CliftonStrengths reconnu mondialement. Dans cette nouvelle édition de l\'ouvrage Découvrez vos points forts, Tom Rath expose ; : dans une première partie, les raisons pour lesquelles il est important de découvrir ses points forts : Il est alors conseillé au lecteur de passer le test grâce au code inséré dans l\'ouvrage. dans une deuxième partie, comment appliquer ses points forts avec pour chacun des 34 points forts qui existent, des témoignages de personnes qui possèdent ces points forts, des idées concrètes d\'optimisation de ces talents et les clefs pour collaborer avec les personnes qui en sont dotées. Fondé sur l\'analyse de millions d\'interviews et de données, cette nouvelle version du test est encore plus précise et sûre dans ses résultats.', '2023-03-27'),
(12, 1, 11, 'Les humanités numériques', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d416c5631447741415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126656467653d6375726c26736f757263653d6762735f617069, '2018-10-24', 176, 'Quel avenir faut-il prédire aux humanités ? Les signes d\'une désaffection pour la culture humaniste se sont multipliés au cours des dernières années en France et ailleurs. Dans ce contexte morose et déprimé, le développement des humanités numériques apparaît à certains comme une planche de salut pour des disciplines autrement condamnées à disparaître. Toutefois, réinventer les humanités par le numérique suppose de relever trois défis de taille : leur rapport à la technique, leur relation au politique et enfin à la science elle-même. Les humanités numériques sont très critiquées : pour certains elles relèvent de la poudre aux yeux, pour d\'autres, elles constituent une menace extraordinaire. Mais s\'il y a bien quelque chose que l\'on ne peut contester, c\'est leur capacité à poser de bonnes questions aux différentes disciplines des sciences humaines et sociales. Penser la place que les humanités doivent tenir dans notre monde implique d\'en redéfinir le contrat social et épistémique. Elles sont riches d\'opportunités de ce point de vue : à condition de ne pas dénaturer la spécificité humanistique des pratiques de recherche auxquelles elles s\'appliquent.', '2023-03-27'),
(13, 1, 12, 'Les cigognes sont immortelles', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d714f7467447741415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126656467653d6375726c26736f757263653d6762735f617069, '2018-08-16', 303, 'À Pointe-Noire, dans le quartier Voungou, la vie suit son cours. Autour de la parcelle familiale où il habite avec Maman Pauline et Papa Roger, le jeune collégien Michel a une réputation de rêveur. Mais les tracas du quotidien (argent égaré, retards et distractions, humeur variable des parents, mesquineries des voisins) vont bientôt être emportés par le vent de l\'Histoire. En ce mois de mars 1977 qui devrait marquer l\'arrivée de la petite saison des pluies, le camarade président Marien Ngouabi est brutalement assassiné à Brazzaville. Et cela ne sera pas sans conséquences pour le jeune Michel, qui fera alors, entre autres, l\'apprentissage du mensonge. Partant d\'un univers familial, Alain Mabanckou élargit vite le cercle et nous fait entrer dans la grande fresque du colonialisme, de la décolonisation et des impasses du continent africain, dont le Congo est ici la métaphore puissante et douloureuse. Mêlant l\'intimisme et la tragédie politique, il explore les nuances de l\'âme humaine à travers le regard naïf d\'un adolescent qui, d\'un coup, apprend la vie et son prix. Alain Mabanckou est né en 1966 à Pointe-Noire, au Congo-Brazzaville. Ses œuvres sont traduites dans le monde entier. Il enseigne la littérature francophone à l\'Université de Californie-Los Angeles (UCLA).', '2023-03-27'),
(14, 1, 13, 'Wonder', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d4c694e4846506c4c49724943267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126656467653d6375726c26736f757263653d6762735f617069, '2013-01-10', 328, 'Ne jugez pas un livre sur sa couverture. Ne jugez pas un garçon sur son apparence. \" Je m\'appelle August. Je ne me décrirai pas. Quoi que vous imaginiez, c\'est sans doute pire. \" Né avec une malformation faciale, August, dix ans, n\'est jamais allé à l\'école. Aujourd\'hui, pour la première fois, ses parents l\'envoient au collège... Pourra-t-il convaincre les élèves qu\'il est comme eux ? Dans la lignée du Bizarre incident du chien pendant la nuit, un petit bijou de sensibilité et de drôlerie. Un roman irrésistible sur le destin peu ordinaire d\'August Pullman, un enfant différent. Traduit de l\'anglais (États-Unis) par Juliette Lê', '2023-03-27'),
(15, 1, 5, 'Des comics et des hommes', NULL, '2023-03-27', 478, 'Aux Etats-Unis, les comic books sont un secteur du monde de l\'édition et un phénomène culturel. C\'est dans les années 30, au cœur de la Dépression économique, qu\'apparurent les fascicules agrafés qui prirent le nom de \" comic books \", Jean-Paul Gabilliet retrace l\'épopée éditoriale de ces parutions, avec ses pics, ses crises, ses rebondissements et ses acteurs souvent hauts en couleurs. \'auteur nous emmène dans les coulisses commerciales et économiques d\'un secteur de l\'industrie culturelle en esquissant tout d\'abord une typologie des créateurs de comic books à travers le temps: leurs origines sociales, leurs formations scolaires, leurs combats (presque toujours vains) pour faire valoir leurs droits auprès d\'éditeurs seulement soucieux de rentabilité. Puis, à partir d\'une batterie d\'enquêtes et de sondages dont les plus anciens remontent aux années 20, il répond à la question: \" Qui lit des comic books?\" Enfin, il précise la position de la bande dessinée dans la hiérarchie culturelle aux Etats-Unis : les discours de censure contre les illustrés, stridents au cœur de la guerre froide et plus insidieux aujourd\'hui. Pour les curieux et ls collectionneurs, le livre contient aussi eux bandes dessinées, l\'une fantastique, l\'autre sentimentale, reproduites en noir et blanc à partir de leurs planches originales. Des Comics et des hommes est un ouvrage grand public qui pourra s\'avérer extrêmement utile aux chercheurs francophones désireux d\'approfondir leur connaissance de ce domaine encore peu exploré de l\'histoire culturelle américaine.', '2023-03-27'),
(16, 1, 14, 'Leconte fait son cinéma', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d46597337454141415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126656467653d6375726c26736f757263653d6762735f617069, '2021-09-24', NULL, 'Joub et Nicoby sont de grands admirateurs de Patrice Leconte, à qui l\'on doit Les bronzés, Tandem, Ridicule et tant d\'autres films aussi réussis que différents. Le duo de Dans l\'atelier de Fournier est donc parti à la rencontre du réalisateur, égrenant avec lui un parcours jalonné de films à succès, de rencontres avec des stars mais aussi de doutes, de critiques assassines, de malentendus et même... de BD, puisque Leconte est lui-même dessinateur ! Leconte fait son cinéma : une conversation dessinée pleine de passion et d\'émotion !', '2023-03-27'),
(17, 1, 15, 'La vie nocturne des arbres', NULL, '2023-03-27', 40, 'Entièrement fabriqué à la main, cet ouvrage - au tirage limité et dont chaque exemplaire est numéroté - reproduit en sérigraphie des oeuvres originales d\'artistes Gond (centre de l\'Inde). Un véritable hymne aux arbres où chaque image s\'accompagne d\'un texte qui emmènera les lecteurs - petits et grands - dans le riche univers imaginaire et mythique de cette tribu de la forêt.', '2023-03-27'),
(18, 1, 6, 'La voleuse de fruits', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d656b4567454141415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126656467653d6375726c26736f757263653d6762735f617069, '2021-03-01', 281, 'Relu par l\'auteur', '2023-03-27'),
(19, 2, 5, 'Les couples heureux ont leurs secrets', NULL, '2023-03-27', 343, 'Le docteur Gottman est l\'inventeur d\'une nouvelle science de l\'amour. De sa recherche, menée avec les moyens d\'investigation les plus modernes, il a mis au point une méthode qui permet de déterminer la qualité d\'un mariage, ses aspects positifs et négatifs, son horizon de longévité. Dans cet ouvrage écrit en collaboration avec Nan Silver, il livre ici les secrets de son expertise qui sont aussi ceux d\'une union heureuse et durable.', '2023-03-27'),
(20, 1, 16, 'Je T\'aimerai Toujours', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d76654737787745414341414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126736f757263653d6762735f617069, '2019-10-30', 32, 'Booksellers have sold more than 30 million copies of Love You Forever in paperback and hardcover. Now we have a French-language board version, printed on light, crisp whiteboard and slightly reduced for child-sized hands. Yet it contains every word of the original, which is much-loved by grandparents and parents everywhere. A young mother holds her baby, and while she sings to it she rocks it back and forth. And through her life, and the stages of his life, she holds her son and rocks him back and forth as she tells him that she will love him forever. Softly she sings to him: \"I\'ll love you forever I\'ll like you for always As long as I\'m living My baby you\'ll be.\" The English-language board version is EAN 9780228101048.', '2023-03-27'),
(21, 1, 5, 'Le métier de libraire', NULL, '2023-03-27', NULL, NULL, '2023-03-27'),
(22, 2, 17, 'Bonsoir lune', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d52345147414141414341414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126736f757263653d6762735f617069, '1996-09-01', 0, 'Le rituel du coucher permet de retrouver le calme en disant bonsoir à tous les objets domestiques.', '2023-03-27'),
(23, 1, 18, 'Comment se faire des amis', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d474e686d424141415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126736f757263653d6762735f617069, '2013-02-01', 256, 'Nos relations avec les autres sont déterminantes pour notre qualité de vie ! La facilité de contact est un puissant moteur de succès : être recherché pour ses qualités humaines, créer la sympathie, faire passer ses idées, savoir motiver, corriger sans gâcher une relation de travail... Cela s’apprend ! Ce livre, utile à tous les âges et dans tous les métiers, vous donnera tous les conseils pour développer des relations humaines de qualité, nécessaires à l’efficacité professionnelle et personnelle. Dale Carnegie, leader mondial de la formation continue, est spécialisé dans les entraînements à la communication, au leadership, à la vente, au management et à la prise de parole en public. C’est la source la plus crédible dans ces domaines.', '2023-03-27'),
(24, 1, 19, 'Devine combien je t\'aime', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d67747844504141414341414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126736f757263653d6762735f617069, '1998-07-01', 34, 'Je t\'aime grand comme ça, haut comme ça, jusqu\'au bout des orteils, aussi loin que... Une déclaration d\'amour pleine de charme et de jeunesse d\'un petit lièvre à un grand, d\'un fils à son père.', '2023-03-27'),
(25, 2, 5, 'Ecryme', NULL, '2023-03-27', NULL, NULL, '2023-03-27'),
(26, 1, 20, 'Un rien peut tout changer', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d44317957447741415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126736f757263653d6762735f617069, '2019-05-09', 320, 'Les gens pensent que pour modifier le cours de leur vie, ils doivent faire de grands changements. Dans ce livre, ils découvriront que les plus petits changements couplés à une bonne connaissance de la psychologie et des neurosciences peuvent avoir un effet révolutionnaire sur leur existence et leurs relations.', '2023-03-27'),
(27, 1, 5, 'C\'est Bon de Faire des Bonds', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d5a677a4a736745414341414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126736f757263653d6762735f617069, '2015-11-17', 72, 'THE BELOVED ILLUSTRATIONS OF DR. SEUSS PLUS AN ALL-NEW FRENCH TRANSLATION Publi�e en anglais sous le titre original Hop on Pop, cette nouvelle traduction fran�aise restitue avec bonheur l\'univers des contes du Dr.Seuss, avec ses jeux jubilatoires sur les mots et les sons. C\'est Bon de faire des Bonds est un premier livre id�al pour tous ceux qui d�butent le fran�ais. Les enfants comme les parents s\'amuseront au fil des pages � d�couvrir les personnages improbables et hilarants du Dr.Seuss, ses illustrations d�sormais c�l�bres et le texte qui ne cesse de jongler avec les mots : \"Tonton sur un b�ton\", des \"poissons polissons\" ou une \"souris qui sourit\". C\'est Bon de faire des Bonds amusera tous les jeunes �coliers qui s\'initient au fran�ais, � son vocabulaire et � sa prononciation. Une base ludique et originale pour d�marrer la lecture de cette nouvelle langue !', '2023-03-27'),
(28, 2, 21, 'Comment Capturer Un Farfadet', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d5f6f4f47737745414341414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126736f757263653d6762735f617069, '2018-02-01', 32, '\"À petits pas, silencieusement, des enfants tentent de capturer un farfadet qui s\'est immiscé dans leur demeure. Mais la créature est futée et ne se laissera pas facilement attraper... Ni la trappe, ni le filet, ni la cage ne fonctionne. Il ne reste donc plus qu\'une solution : transformer la maison en piège géant! Un livre amusant sur les créatures imaginaires du folklore irlandais!\"--Résumé de l\'éditeur.', '2023-03-27'),
(29, 2, 5, 'Chroniques oubliées : fantasy : Anathazerïn', NULL, '2023-03-27', 440, NULL, '2023-03-27'),
(30, 1, 22, 'Le seigneur des anneaux', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d71675735504141414341414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126736f757263653d6762735f617069, '2023-03-27', 569, 'Avec \" Le Retour du Roi \" s\'achèvent dans un fracas d\'apocalypse les derniers combats de la guerre de l\'Anneau. Tandis que le continent se couvre de ténèbres, annonçant pour le peuple des Hobbits l\'aube d\'une ère nouvelle, Frodon poursuit son entreprise. Alors qu\'il n\'a pu franchir la Porte Noire, il se demande comment atteindre le Mont du Destin. Peut-être est-il trop tard : le Seigneur des Ténèbres mobilise ses troupes. Les Rohirrim n\'ont plus le temps d\'en finir avec le traître assiégé dans l\'imprenable tour d\'Orthanc ; ils doivent se rassembler pour faire face à l\'ennemi. Tentant une fois de plus sa chance, Frodon passe par le Haut Col, où il sera livré à l\'abominable Arachné. Survivra-t-il à son dangereux périple à travers le Pays Noir ?', '2023-03-27'),
(31, 1, 5, 'Le chat chapeauté', NULL, '2016-10-13', NULL, 'Par un jour de pluie, Sally et son frère s\'ennuient, s\'ennuient... jusqu\'à l\'arrivée du Chat Chapeauté, qui sème la pagaille dans toute la maisonnée. Que faire ? Laisser le Chat Chapeauté jouer les fauteurs de trouble, ou bien le renvoyer ?', '2023-03-27'),
(32, 1, 12, 'Conversations entre amis', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d666c4471447741415142414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126736f757263653d6762735f617069, '2019-09-05', 262, 'Dublin, de nos jours. Frances et Bobbi, deux anciennes amantes devenues amies intimes, se produisent dans la jeune scène artistique irlandaise comme poètes-performeuses. Un soir, lors d\'une lecture, elles rencontrent Melissa, une photographe plus âgée qu\'elles, mariée à Nick, un acteur. Ensemble, ils discutent, refont le monde, critiquent le capitalisme comme les personnages de Joyce pouvaient, en leur temps, critiquer la religion. Ils font des photographies, ils écrivent, ils vivent. C\'est le début d\'une histoire d\'amitié, d\'une histoire de séduction menant à un \" mariage à quatre \" où la confusion des sentiments fait rage : quand Frances tombe follement amoureuse de Nick et vit avec lui une liaison torride, elle menace soudainement l\'équilibre global de leur amitié. Mais Conversations entre amis n\'est pas qu\'une banale histoire d\'adultère : c\'est avant tout le portrait attachant, empathique, des jeunes gens contemporains, ces millenials qui ne parviennent pas à trouver leur place dans le monde que leur ont laissé leurs aînés. La voix de Frances, poétique, désinvolte, parfois naïve, d\'une extraordinaire fraîcheur est, par de multiples aspects, celle de sa génération. Traduit de l\'anglais (Irlande) par Laetitia Devaux.', '2023-03-27'),
(33, 1, 23, 'Tika Tika Boum Boum!', 0x687474703a2f2f626f6f6b732e676f6f676c652e636f6d2f626f6f6b732f636f6e74656e743f69643d67356f62766741414341414a267072696e747365633d66726f6e74636f76657226696d673d31267a6f6f6d3d3126736f757263653d6762735f617069, '2017-09-01', 40, 'See below for English description. Ce classique séduit depuis plus de vingt ans les enfants partout à travers le monde. Il a été traduit à la demande générale. Les lettres de l\'alphabet se rejoignent au sommet du cocotier jusqu\'à ce que. oh non! Elles tombent toutes en bas. Une comptine rythmée et amusante avec laquelle les enfants d\'âge préscolaire pourront apprendre l\'alphabet. In this lively alphabet rhyme, all the letters of the alphabet race each other up the coconut tree. Will there be enough room? Oh, no - Tika Tika Boum! Boum! The well-known authors of Barn Dance and Knots on a Counting Rope have created a rhythmic alphabet chant that rolls along on waves of fun. Lois Ehlert\'s rainbow of bright, bold, cheerful colours makes the merry parade of letters unforgettable. Original title: Chicka Chicka Boom Boom', '2023-03-27'),
(34, 1, 5, 'La fille qui court', NULL, '2020-09-03', 424, NULL, '2023-03-27'),
(35, 1, 5, 'Maus', NULL, '2023-03-27', 299, NULL, '2023-03-27'),
(36, 2, 5, 'Ici', NULL, '2023-03-27', 96, NULL, '2023-03-27'),
(37, 1, 5, 'La chenille qui fait des trous', NULL, '2019-02-14', 8, NULL, '2023-03-27'),
(38, 1, 5, 'Ours brun, dis-moi ce que tu vois ?', NULL, '2023-03-27', 21, 'Ours Brun, dis-moi ce que tu vois ? Je vois un oiseau rouge, un cheval bleu... Un imagier pour apprendre les couleurs.', '2023-03-27'),
(39, 1, 5, 'Le livre du rien', NULL, '2020-09-03', 64, NULL, '2023-03-27'),
(40, 1, 5, 'Gallant', NULL, '2022-03-10', 376, NULL, '2023-03-27');
